  input: 'TEXT,F3A,,"This memo is in regard to the campaign contribution dated 5/19/06
    in the amount of $2,000.  It should have been reported under the 48 hour notice
    deadline, but I did not receive notice of the deposit made into the campaign bank
    account until 5/25/06.  Based on my understanding at the time, on 5/25/06 I used
    the FEC website to submit the amount as a loan made to the committee by Barbara
    Chambers, the candidate''s wife.  Later, when preparing to file the July quarterly
    FEC report, I found that the $2,000 was actually supposed to be a contribution
    split between Robert Chambers, the candidate, and his wife Barbara Chambers.  In
    a letter to me, in my capacity as campaign treasurer, dated July 13, 2006 and
    signed by both, they stated that $1600 was to be a contribution from Barbara and
    $400 was to be a contribution from Robert.  Today, September 20, 2006, I deleted
    the entry showing the loan on 5/19/06 and made two entries reflecting the $2000
    split between Robert and Barbara.  This memo is also in response to a letter to
    me from the FEC dated August 22, 2006, requesting an explanation of the 5/19/06
    contribution.  Signed, Jennifer T. Hansen, Treasurer, Committee to Elect Chambers
    for Congress, ID # C00417055."'
